import './App.css';
import uuid from 'react-uuid'
import React, { useState } from 'react';



function App() {
   const [value1, setValue1] = useState(0);
   const [value2, setValue2] = useState(0);
   const [result, setResult] = useState("-")

   const  handleChange1 = (event) => setValue1(+event.target.value);
   const handleChange2 = (event) => setValue2(+event.target.value);

   return <div>
       <input value = {value1} onChange = {handleChange1}/>
       <input value = {value2} onChange = {handleChange2}/>
       <button onClick = {()=> setResult(value2 + value1)}>amount</button>
       <button onClick = {() => setResult(value1 - value2)}>difference</button>
       <p>result: {result}</p>
   </div>

}

export default App;
